Chordizer.G=function(b,a){this.addChord(b,"G",0,a).addOpenString(["G","D"]).addFretPress(3,["LowE","H","HighE"]).addFretPress(2,"A")};Chordizer.Gv2=function(b,a){this.addChord(b,"G",0,a).addOpenString(["G","D","H"]).addFretPress(3,["LowE","HighE"]).addFretPress(2,"A")};Chordizer.G_H=function(b,a){this.addChord(b,"G/H",0,a).addMute(["LowE","HighE"]).addOpenString(["G","D","H"]).addFretPress(2,"A")};Chordizer.Gm=function(b,a){this.addChord(b,"Gm",3,a).addBarre(1,"LowE","HighE").addFretPress(3,["A","D"])};Chordizer.Gis=function(b,a){this.addChord(b,"G#",4,a).addBarre(1,"LowE","HighE").addFretPress(2,"G").addFretPress(3,["A","D"])};